        return (
            <div className="tablestyle">   
                <h1>posts</h1>
                
                <button onClick="Poststable.onHandleDown();">◁</button>
                <button onClick="Poststable.onHandleUp();">▷</button>

                <div>
                    <Poststable ></Poststable>
                </div>
                
            </div>
        );
    }
}
export default Posts;
